data.text:
@MaurizioDG_tale @marcogrenoble84 @ConteZero76 @CarloCalenda Diritti e prerogative... Sinonimi, che vuoi. 😁

Comunque dai, stiamo in una discussione su Twitter: non attacchiamoci ai dettagli
Torniamo al punto capitale: perché imbarcarsi in una campagna elettorale suicida e consegnare il Paese a un proto-nazista sarebbe giusto e opportuno?

@ChristianConte_ @CarloCalenda E se si dimette chi arriva? Finché c'è questo Governo un suo uomo. E siamo da capo.

Il nuovo esecutivo può durare anche a lungo, anche se nasce fragile. Per via del potere della poltrona.

Comunque un rischio mille volte minore di affrontare una campagna elettorale suicida.

@CarloCalenda Carlo, ti prego, ti scongiuro: fai il vero leader! 

Non cercare di far contenti e di non tradire i tuoi sostenitori ma prendi il coraggio, dì che ti sei sbagliato e fai l'unica cosa logica.

Abbandona questa battaglia suicida! Vinciamo la guerra! Ne va del nostro Paese.
